struct LID {
	int a,b,sz;
	int sx,sy;
	bool operator < (const LID &t) const {
		if (t.sx!=sx) return sx<t.sx;
		if (t.sy!=sy) return sy<t.sy;
		if (t.a!=a) return a<t.a;
		if (t.b!=b) return b<t.b;
		return sz<t.sz;
	}
};

